import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import MainNav from "./Components/MainNav.jsx";
import GlobalFooter from "./Components/GlobalFooter.jsx"
import BreadthFirstSearch from "./Components/AlgoView/BreadthFirstSearch.jsx";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.min.js";
import "./TraversalVisualiser.css";
const Algorithms = require("./Models/Algorithms.json");
const App = () => {
	const [view, setView] = useState("dfs");
	useEffect(() => {}, [view]);

	const toggleView = changeTo => {
		setView(changeTo);
	};
	return (
		<Container
			id="container"
			fluid
			data-bs-theme="dark"
			className="min-vh-100 min-vw-100"
		>
			<MainNav toggle={toggleView} />

			{(() => {
				switch (view) {
					case "bfs":
						return (
							<BreadthFirstSearch Algorithm={Algorithms.bfs} />
						);
				}
			})()}
			<GlobalFooter />
		</Container>
	);
};

export default App;
